import IronGlovesImg from './iron-gloves.png';

const IronGloves = {
    name: 'Iron Gloves',
    type: 'armor::gloves',
    effect: {
        defence: 4,
    },
    image: IronGlovesImg,
    value: 50,
};

export default IronGloves;
